import React ,{Component,Fragment} from 'react';
import DemoItem from './DemoItem';


class Demo extends Component{
    constructor(props){
        super(props);
        this.state={
            list:[],
            value:''
        }
    }
    render(){
        return (
            <Fragment>
                <div>
                    输入内容：
                    <input placeholder='内容'></input>
                    <button>提交</button>
                </div>
                <ul>
                    <DemoItem/>
                </ul>
            </Fragment>
        )
    }

}

export default Demo;
